import React from 'react'
import Form from 'react-bootstrap/Form'

export default function Editor() {
	return (
		<Form>
			<Form.Group>
				<Form.Label>Title</Form.Label>
				<Form.Label>Content</Form.Label>
			</Form.Group>
		</Form>
	)
}
